Information
------------------------------

The Truth Behind
Myth or reality? Fact or fiction? The Truth Behind takes a forensic look at the world's most popular and enduring mysteries, from the &quot;lost&quot; city of Atlantis to the Loch Ness monster,and UFOs . Using the latest scientific technology, expert opinions, and ground-breaking experiments, this series explores the most fascinating and perplexing of unexplained phenomena, delving deep into the science behind the legends.They say the truth is out there - but can mankind's biggest mysteries ever be solved? In The Truth Behind meet the men and women determined to separate the fact from the fiction as they delve deep into the realms of the unexplained.
The Truth Behind: UFOs
With thousands of UFOs sightings worldwide every year, can our alien experiences really all be put down to imagination? Alex Podovich of Las Vegas UFO Hunters travels to the Extra-terrestrial Highway in Nevada and Peter Merlin visits a supposed crash site in search of evidence of what happened.

